import React from "react";
import { Button, Navbar, Icon } from 'react-bootstrap';

const Header =() => {
	return (
		<Navbar brand={<a />} alignLinks="right">
		<Button node="a">
			button
		</Button>
		<Button node="a">
			button 
		<Icon right>
		cloud
		</Icon>
		</Button>
		<Button node="a" large>
		large button
		</Button>
		</Navbar>

		);
}
 export default Header;
